import logo from './logo.svg';
import './App.css';
import {Router} from 'react-router-dom'

function App() {
  return (
      <Router>
          <div className="App">
              <ul>
                  <li>
                      <Link to="/">Home</Link>
                  </li>
                  <li>
                      <Link to="/about">About Us</Link>
                  </li>
                  <li>
                      <Link to="/contact">Contact Us</Link>
                  </li>
              </ul>
          </div>
      </Router>
  );
}

export default App;
